import React from 'react'
//import { css } from '@emotion/react';
import styled from '@emotion/styled';

const Footer = styled.section`
display: flex;
background-color: #11050f;
height: 566px;
width: 100%;
`

export default function footer() {
  return (
    <Footer>
      <h1>Hey</h1>
    </Footer>
  )
}
